import React from 'react';
import logo from './logo.svg';
import './App.css';
import Image from './components/Image'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Image pic="https://mppmduse2pmpovwapp.azurewebsites.net/wp-content/uploads/2019/09/netflix-background-9.jpg" child = {[<Image pic="https://download.logo.wine/logo/Netflix/Netflix-Logo.wine.png" style = "size:10%"/>]}/>

      </header>
    </div>
  );
}

export default App;
